import React, { useEffect } from 'react';

const aichatbot = () => {
    useEffect(() => {
        const script = document.createElement('script');
        script.src = 'https://cdn.botpress.cloud/webchat/v1/inject.js';
        script.async = true;
        document.body.appendChild(script);
    
        const initScript = document.createElement('script');
        initScript.innerHTML = `
          window.botpressWebChat.init({
            "composerPlaceholder": "Chat with Voyager",
            "botConversationDescription": "This chatbot was built surprisingly fast with Botpress",
            "botId": "9b2d12e9-3885-4dcd-91c9-d7fd3fb9c2e9",
            "hostUrl": "https://cdn.botpress.cloud/webchat/v1",
            "messagingUrl": "https://messaging.botpress.cloud",
            "clientId": "9b2d12e9-3885-4dcd-91c9-d7fd3fb9c2e9",
            "webhookId": "51a2bcc3-0549-4c84-804f-d2ca7caeb433",
            "lazySocket": true,
            "themeName": "prism",
            "botName": "Voyager",
            "frontendVersion": "v1",
            "useSessionStorage": true,
            "theme": "prism",
            "themeColor": "#2563eb"
          });
        `;
        document.body.appendChild(initScript);
    
        // Cleanup function to remove the script elements when the component unmounts
        return () => {
          document.body.removeChild(script);
          document.body.removeChild(initScript);
        };
      }, []);
    
      return null; // or any JSX element you want to render
    };

export default aichatbot
